#!/usr/bin/env python3

DNA = ''.lower()

print('DNA:\t', DNA, '\n')

complement = DNA.replace('g', 'C')
complement = complement.replace('a', 'T')
complement = complement.replace ('c', 'G')
complement = complement.replace('t','A')

print('Complement:\t', complement, '\n')

reverse_complement = complement[::-1]
print('Reverse Complement:\t', reverse_complement, '\n')



